import { Navigate } from "react-router-dom";
const ProtectRouting_u = ({Child}) => {
    let x=localStorage.getItem("product")
    let verifyprotect=()=>
    {
        if(x==null)
        {
            return false;
        }
        else
        {
            return true;
        }
    }
    return ( 
            <div>
              {verifyprotect() ? <Child/> :<Navigate to="/" />}
            </div>
     );
}
 
export default ProtectRouting_u;
